<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 rediscovered : the new biology and targeting the androgen receptor therapeutically . Discoveries over the past decade suggest that castration-resistant prostate cancer ( CRPC ) is sensitive , but not resistant to , further manipulation of the androgen-androgen receptor ( AR ) axis . Several new therapies that target this axis have demonstrated clinical activity . In this article , preclinical and clinical findings occurring in the field of AR-targeted therapies are reviewed . Reviews of scientific and clinical development are divided into those occurring prereceptor ( androgen production and conversion ) and at the level of the receptor ( AR aberrations and therapies targeting AR directly ) . Intracrine androgen production and AR amplification , among others , are among the principal aberrancies driving CRPC growth . Phase III data with abiraterone acetate and phase II data with 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08899
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 , along with other similar therapies , confirm for the clinician that the scientific findings related to persistent AR signaling in a castrate milieu can be harnessed to produce significant clinical benefit for patients with the disease . Studies aimed at optimizing the timing of their use and exploring the mechanisms of resistance to these therapies are under way . The clinical success of therapies that directly target androgen synthesis as well as the most common aberrancies of the AR confirm that prostate cancer retains dependence on AR signaling , even in the castrate state .</div>

 , a murine monoclonal antibody that is directed against the tumor-associated antigen Q8WXI7 . Most patients were pretreated heavily . Biologic activity was quantified by the assay of immune responses to the human anti-murine antibodies against the monoclonal antibody -

 variable region ( Ab ( 2 ) ) and antibodies that target the CA 125 antigen itself ( anti-CA 125 antibody ) . RESULTS : More than one half of patients ( 56.8 % ) survived for &gt; 12 months after the first dose of monoclonal antibody

 ; 34.1 % of the patients survived &gt; 24 months . To date , 6 of the 44 patients are alive , with survival times of 4 to 7.5 years after the start of the antibody treatment . More than 60 % of the evaluable patients met predefined criteria for robust , treatment-emergent human anti-murine antibodies and Ab ( 2 ) responses , and these responses were associated with improved survival rates . Median survival time increased approximately 3 - fold for human anti-murine antibody responders ( 22.6 months ) versus nonresponders ( 7.2 months ; P &lt; . 0016 , log-rank test ) and 2 - fold for Ab ( 2 ) responders ( 18.3 months ) versus nonresponders ( 9.3 months ) . No serious drug-associated adverse events were reported . CONCLUSION : The associations between multiple types of immune response and improved clinical outcomes suggest that monoclonal antibody -

 should be further evaluated for potential use as an immunotherapy for Q8WXI7 - expressing malignancies .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Mixed adenoneuroendocrine carcinomas of the gastrointestinal tract : targeted next-generation sequencing suggests a monoclonal origin of the two components . BACKGROUND : Mixed adenoneuroendocrine carcinomas ( MANECs ) of the gastrointestinal tract are rare neoplasms characterized by coexisting exocrine and neuroendocrine neoplastic components . MANECs ' histogenetic classification and molecular characterization remain unclear , significantly affecting the identification of innovative therapeutic options for these tumors . METHODS : The exocrine and neuroendocrine components of 6 gastrointestinal MANECs were microdissected and subjected to the simultaneous mutation assessment in selected regions of 54 cancer-associated genes using Ion Torrent semiconductor-based next-generation sequencing . Sanger sequencing and immunohistochemistry were used as validation of the mutational status . RESULTS : A total of 20 driver gene somatic mutations were observed among the 12 neoplastic components investigated . In 11 of 12 ( 91.7 % ) samples , at least one mutation was detected ; 7 samples ( 58.3 % ) were found to have multiple mutations .

<div class="entities" style="line-height: 2.5; direction: ltr">DB02546 and bortezomib synergistically cause ubiquitinated protein accumulation in prostate cancer cells . PURPOSE : Protein ubiquitination is a novel strategy used to treat malignancies . We investigated whether the histone deacetylase inhibitor vorinostat ( Cayman Chemical , Ann Arbor , Michigan ) and the proteasome inhibitor bortezomib ( LC Laboratories , Woburn , Massachusetts ) would synergistically cause the accumulation of ubiquitinated proteins in prostate cancer cells . MATERIALS AND METHODS : LNCaP , PC - 3 and DU 145 cells ( ATCC ™ ) were treated with vorinostat and / or bortezomib . Cell viability and induction of apoptosis were assessed . In vivo efficacy was evaluated in a murine subcutaneous tumor model using PC - 3 cells . The influence of androgen receptor expression on bortezomib efficacy was examined using RNA interference . Changes in the expression of ubiquitinated proteins , cell cycle associated proteins and acetylated histone were evaluated . RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 expression seemed to decrease bortezomib activity . PC - 3 and DU 145 cells were more susceptible to bortezomib than LNCaP cells and the silencing of androgen receptor expression in LNCaP cells enhanced bortezomib activity . DB02546 and bortezomib synergistically induced apoptosis , inhibited prostate cancer cell growth and suppressed tumor growth in a murine xenograft model . The combination decreased cyclin D1 and cyclin-dependent kinase 4 expression , and increased 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P38936
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 expression . The combination synergistically caused the accumulation of ubiquitinated proteins and histone acetylation . This histone acetylation was a consequence of the accumulation of ubiquitinated proteins . CONCLUSIONS : DB02546 and bortezomib inhibit the growth of prostate cancer cells synergistically by causing ubiquitinated proteins to accumulate in cells . The current study provides a framework for testing the combination in patients with advanced prostate cancer .</div>

 and p53 protein . While such agents have undergone extensive study in many solid tumor types , the additional importance of

 and p53 in restraining transcription of the AR gene within the prostate provides impetus for examining how loss of these two tumor suppressor proteins can facilitate transition of prostate cancers to CRPC . As will be reviewed in this article , restoration of

 and p53 functions are not only important in regard to shortterm cell cycle regulation and response to genomic stresses , but likely have direct implications for deregulation of the AR locus .</div>

<h2 style="margin: 0">20</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Gq-mediated Akt translocation to the membrane : a novel PIP 3 - independent mechanism in platelets . Akt is an important signaling molecule regulating platelet aggregation . Akt is phosphorylated after translocation to the membrane through Gi signaling pathways by a phosphatidylinositol -3,4 , 5 - trisphosphate ( PIP 3 ) - dependent mechanism . However , Akt is more robustly phosphorylated by thrombin compared with adenosine 5 ' - diphosphate in platelets . This study investigated the mechanisms of Akt translocation as a possible explanation for this difference . Stimulation of washed human platelets with protease-activated receptor agonists caused translocation of Akt to the membrane rapidly , whereas phosphorylation occurred later . The translocation of Akt was abolished in the presence of a Gq-selective inhibitor or in Gq-deficient murine platelets , indicating that Akt translocation is regulated downstream of Gq pathways . Interestingly , phosphatidylinositol 3 - kinase ( PI3K ) inhibitors or 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q9H244
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 antagonist abolished Akt phosphorylation without affecting Akt translocation to the membrane , suggesting that Akt translocation occurs through a PI3K / PIP 3 / Gi-independent mechanism . An Akt scaffolding protein , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P38936
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - activated kinase ( PAK ) , translocates to the membrane after stimulation with protease-activated receptor agonists in a Gq-dependent manner , with the kinetics of translocation similar to that of Akt . Coimmunoprecipitation studies showed constitutive association of PAK and Akt , suggesting a possible role of PAK in Akt translocation . These results show , for the first time , an important role of the Gq pathway in mediating Akt translocation to the membrane in a novel Gi / PI3K / PIP 3 - independent mechanism .</div>
